import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { format } from 'date-fns';

const App = () => {
  const [latestRates, setLatestRates] = useState([]);
  const [historicalRates, setHistoricalRates] = useState([]);
  const [selectedDate, setSelectedDate] = useState(new Date());

  useEffect(() => {
    fetchLatestRates();
  }, []);

  const fetchLatestRates = async () => {
    try {
      const response = await axios.get('http://localhost:3001/api/latest-rates');
      setLatestRates(response.data);
    } catch (error) {
      console.error('Error fetching latest rates:', error);
    }
  };

  const fetchHistoricalRates = async (date) => {
    try {
      const formattedDate = format(date, 'yyyy-MM-dd');
      const response = await axios.get(`http://localhost:3001/api/historical-rates/${formattedDate}`);
      setHistoricalRates(response.data);
    } catch (error) {
      console.error('Error fetching historical rates:', error);
    }
  };
  const formatDate = (date) => {
    return format(new Date(date), 'dd-MM-yyyy');
  };

  const handleDateChange = (date) => {
    setSelectedDate(date);
    fetchHistoricalRates(date);
  };

  return (
    <div className="container">
      <div>
          <h1>Yet Another Forex</h1>
          <div>
                  <div>Rates as of 31-03-2021</div>
                  <div><input type="date" value={format(selectedDate, 'yyyy-MM-dd')} onChange={(e) => handleDateChange(new Date(e.target.value))} /></div>
          </div>


          <div class="container">
              <div class="currency-box">
                  <div class="currency-name">USD</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">CAD</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">HKD</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">PHP</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">HUF</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">AUD</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">JPY</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">KRW</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">MXN</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">MYR</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">NZD</div>
                  <div class="currency-rate">1.2296</div>
              </div>
              <div class="currency-box">
                  <div class="currency-name">CNY</div>
                  <div class="currency-rate">1.2296</div>
              </div>
          </div>
      </div>

    </div>
  );
};

export default App;
